import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import HostelBook from "./HostelBook";
import ViewAll from "./ViewAll";
//import MainHome from "./MainHome";
import "./App.css";

const App = (props) => {
  var log = props.logincond;
  return (
    <>
      <Router>
        <div className="header">
          <span className="head"> Hostel Management System</span>
          <span className="Link2" ><Link to="/" style={{ textDecoration: 'none' }}>Resister</Link></span>
          <span className="Link1" ><Link to="/login" style={{ textDecoration: 'none' }}>login</Link></span>
          {
            log ? console.log("login") : console.log("not login")
          }
          <span className="Link1" ><Link to="/home" style={{ textDecoration: 'none' }}>Home</Link></span>
          <span className="Link1"> <Link to="/bookhostel" style={{ textDecoration: 'none' }}>Book Hostel</Link></span>
          <span className="Link1"><Link to="/viewall" style={{ textDecoration: 'none' }}>All Student</Link></span>
          <span className="Link1"><Link to="/login" style={{ textDecoration: 'none' }}>Logout</Link></span>
        </div>
        <Switch>
          <Route exact path="/">
            <Registration />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/bookhostel">
            <HostelBook />
          </Route>
          <Route path="/viewall">
            <ViewAll />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
